The fifth musketeer (1977)(nl subs) B-Sam




Oostenrijk / West-Duitsland
Avontuur
116 minuten

geregisseerd door Ken Annakin
met Sylvia Kristel, Beau Bridges en Ursula Andress

Het is 1662 en terwijl de bevolking van Frankrijk wordt gekweld door armoede en honger, doet koning Lodewijk XIV zich tegoed aan pleziertjes. Van de Musketiers staat alleen D'Artagnan nog achter de vorst, de andere drie heren hebben zich inmiddels teruggetrokken. Het trio besluit uiteindelijk toch om tegen Lodewijk XIV in opstand te komen. De beste methode om de koning een hak te zetten is het bevrijden van zijn tweelingbroer.

English

King Louis XIV has without his knowledge a twin brother, Philippe, but when he is told, he immediately locks him up in the Bastille. The king wants to increase his popularity and stages an assassination against himself where Philippe is dressed as king Louis. But Philippe manages to escape the assassination and everybody believes him to be the real king... 




